    true,nt"url": null,nt"notes": "BEA's fixed assets accounts includes a wide
    array of statistics on both fixed assets, which are used continuously in processes
    of production for an extended period of time, and consumer durables, which are generally
    defined as tangible products that can be stored or inventoried and that have an
    average life of at least three years. Statistics on net stocks, depreciation (consumption
    of fixed capital), other changes in volume of assets, and the average age of net
    stocks are available, beginning with 1925; estimates of fixed investment are available,
    beginning with 1901. These statistics are available by industry, by legal form of
    organization, and by asset type.",nt"license_title": "U.S. Government Work",nt"extras":
